using namespace std;

class Bonsai_fp
{
    int Projected_Dimension, Original_Dimension, Tree_Height, Number_Of_Labels;
    float sigma, ***W_fp, ***V_fp, **Z_fp, **Theta_fp;

public:
    Bonsai_fp(int pd,int od, int th, int nl, float sg, float ***W,float ***V,float **Z,float **T)
    {
        Projected_Dimension = pd;
        Original_Dimension = od;
        Tree_Height = th;
        Number_Of_Labels = nl;
        sigma = sg;
        W_fp = W;
        V_fp = V;
        Z_fp = Z;
        Theta_fp = T;
    }
    float* Get_Score(float *Original_Data_Point_fp, bool mode)
    {
        int i,j,k,Current_Node=0;
        float *Score_fp,a,b,Sum;
        Score_fp = (float*)malloc(Number_Of_Labels*sizeof(float));
        memset(Score_fp,0,Number_Of_Labels*sizeof(float));
        if(mode)
        {
            float *Projected_Data_Point_fp;
            Projected_Data_Point_fp = (float*)malloc(Projected_Dimension*sizeof(float*));
            memset(Projected_Data_Point_fp,0,Projected_Dimension*sizeof(float));
            for(i=0;i<Projected_Dimension;i++)
            {
                for(j=0;j<Original_Dimension;j++)
                    Projected_Data_Point_fp[i] += Z_fp[i][j] * Original_Data_Point_fp[j];
            }		

            for(i=0;i<Tree_Height;i++)
            {
                for(j=0;j<Number_Of_Labels;j++)
                {
                    a = 0;
                    b = 0;
                    for(k=0;k<Projected_Dimension;k++)
                    {
                        a += W_fp[Current_Node][k][j] * Projected_Data_Point_fp[k];
                        b += V_fp[Current_Node][k][j] * Projected_Data_Point_fp[k];
                    }
                    Score_fp[j] += a * tanh(sigma * b);
                }
                Sum = 0;
                for(j=0;j<Projected_Dimension;j++)
                    Sum += Theta_fp[Current_Node][j]*Projected_Data_Point_fp[j];
                Current_Node = (Sum > 0)? Current_Node * 2 + 1: Current_Node * 2 + 2;
            }
            for(j=0;j<Number_Of_Labels;j++)
            {
                a = 0;
                b = 0;
                for(k=0;k<Projected_Dimension;k++)
                {
                    a += W_fp[Current_Node][k][j] * Projected_Data_Point_fp[k];
                    b += V_fp[Current_Node][k][j] * Projected_Data_Point_fp[k];
                }
                Score_fp[j] += a * tanh(sigma * b);
            }
        }
        else
        {
            for(i=0;i<Tree_Height;i++)
            {
                for(j=0;j<Number_Of_Labels;j++)
                {
                    a = 0;
                    b = 0;
                    for(k=0;k<Projected_Dimension;k++)
                    {
                        a += W_fp[Current_Node][k][j] * Original_Data_Point_fp[k];
                        b += V_fp[Current_Node][k][j] * Original_Data_Point_fp[k];
                    }
                    Score_fp[j] += a * tanh(sigma * b);
                }
                Sum = 0;
                for(j=0;j<Projected_Dimension;j++)
                    Sum += Theta_fp[Current_Node][j]*Original_Data_Point_fp[j];
                Current_Node = (Sum > 0)? Current_Node * 2 + 1: Current_Node * 2 + 2;
            }
            for(j=0;j<Number_Of_Labels;j++)
            {
                a = 0;
                b = 0;
                for(k=0;k<Projected_Dimension;k++)
                {
                    a += W_fp[Current_Node][k][j] * Original_Data_Point_fp[k];
                    b += V_fp[Current_Node][k][j] * Original_Data_Point_fp[k];
                }
                Score_fp[j] += a * tanh(sigma * b);
            }
        }
		for(j=0;j<Number_Of_Labels;j++)
            Serial.println(Score_fp[j]);
        //for(j=0;j<Number_Of_Labels;j++)
        //    cout<<Score_fp[j]<<endl;
        return Score_fp;
    }
};

